  cursor: pointer;
}

.fixedButtons__button {
  position: relative;

  display: flex;
  justify-content: center;
  align-items: center;

  border: 1px solid rgba(56, 143, 174, 0.15);
  border-radius: 100%;
  width: 68px;
  height: 68px;

  backdrop-filter: blur(10px);
  background: rgba(255, 255, 255, 0.9);
  box-shadow: 0 0 24px 0 rgba(25, 48, 56, 0.36);
  cursor: pointer;
}

.fixedButtons__button::before {
  content: '';
  position: absolute;
  border: 2px solid #06739a;
  left: -20px;
  opacity: 0;
  right: -20px;
  top: -20px;
  bottom: -20px;
  border-radius: 50%;
  animation: fixedButtons__button 2.5s linear infinite;
}

@keyframes fixedButtons__button {
  0% {
    transform: scale(0.5);
    opacity: 0;
  }
  50% {
    opacity: 0.5;
  }
  100% {
    transform: scale(1.2);
    opacity: 0;
